/**
 * A function to convert a text "string" to "<string/>". It uses spans and HTML info.
 * It is used for titles.
 *
 * ---
 *
 * The real conversion is like:
 * ```html
 * <span>&lt;</span>{{{text}}}<span>/&gt;</span>
 * ```
 * @param {String} text - The text to convert
 * @returns {String} - An html string
 */
function tag(text) {
  return `<span>&lt;</span>${text}<span>/&gt;</span>`;
}

/**
 * It capitalizes the first letter of a String. "string" -> "String"
 * @param {String} str - The string to capitalize
 * @returns {String} - The capitalized string
 */
function capitalizeFirstLetter(str) {
  return str.charAt(0).toUpperCase() + str.slice(1);
}

/**
 * A function to create the dom of a element that is in a section.
 * @param {Object} options - An object with the section options. (title, description, author)
 * @returns {String} - An html string
 */
function selement(options) {
  return `
                <div class="sectionelement">
                    <div class="image">
                        <img loading="lazy" alt="" src="${options.img_url}">
                    </div>
                    <div class="selem-content">
                        <h1>${options.title}</h1>
                        <h3>${options.desc}</h3>
                        <h5>by @<b>${options.author}</b></h5>
                    </div>
                </div>`;
}

/**
 * A function for creating a section
 * @param {String} title - The section title
 * @param {Array} elements - An array of section elements
 * @param {String} url - An url for redirecting when you click on "Show more..."
 * @returns {String} - An html string.
 */
function section(title, elements, url = title) {
  var selements = "";
  elements.forEach((element) => {
    selements += selement(element);
  });
  return `
        <section>
            <div class="section-title">
                <h2>${tag(capitalizeFirstLetter(title))}</h2>
                <a href="explore/${url}/">See more</a>
            </div>
            <div class="sectionelements">
                ${selements}
            </div>
        </section>`;
}

