/**
 * Loads the explore page.
 */
export default function Load() {
  document.querySelector("#app").innerHTML = `
        <header class="explore-header">
            ${squares}
            ${svg}
            <h1>${tag("EXPLORE")}</h1>
            <h2>Take a look at all the public AiraCloud projects<br>
            made by the community</h1>
            <div class="search">
                <img loading="lazy" src="https://swiftlystatic.vercel.app/airacloud/icon?icon=search&amp;fill=white&amp;regular=true" width="20px">
                <input placeholder="Search...">
            </div>
        </header>
        ${featured}
        `;
  const scrollContainers = document.querySelectorAll(".sectionelements");

  scrollContainers.forEach((scrollContainer) => {
    scrollContainer.addEventListener("wheel", (evt) => {
      evt.preventDefault();

      if (evt.deltaY >= -15 && evt.deltaY <= 15) {
        scrollContainer.scrollLeft += evt.deltaY * 40;
      } else {
        scrollContainer.scrollLeft += evt.deltaY * 5;
      }
    });
  });
}
